{"language":"Solidity","sources":{"contracts/walkwalk.sol":{"content":"// SPDX-License-Identifier: MIT
pragma solidity >=0.8.19 <0.9.0;

contract WalkWalk {
    struct ExerciseData {
        uint id;
        uint memberId;
        uint steps;
        uint exerciseMinute;
        string exerciseDistance;
        string exerciseDay;
        string exerciseStart;
        string exerciseEnd;
        string calorie;
    }

    struct Receipt {
        string walletType;
        bool operator;
        uint price;
        string description;
        string createdAt;
        uint memberId;
    }

    // ID를 기반으로 한 ExerciseData 저장
    mapping(uint => ExerciseData) public exerciseDatas;
    // Receipt 데이터를 저장하는 배열
    Receipt[] public receipts;

    // 이벤트 선언
    event ExerciseDataAdded(uint id, uint memberId, uint steps, uint exerciseMinute, string exerciseDistance, string exerciseDay, string exerciseStart, string exerciseEnd, string calorie);
    event ReceiptAdded(uint receiptId, string walletType, bool operator, uint price, string description, string createdAt, uint memberId);

    // 운동 데이터 추가 함수
    function addExerciseData(uint id, uint memberId, uint steps, uint exerciseMinute, string memory exerciseDistance, string memory exerciseDay, string memory exerciseStart, string memory exerciseEnd, string memory calorie) public {
        require(exerciseDatas[id].id == 0, "ID already exists.");
        exerciseDatas[id] = ExerciseData(id, memberId, steps, exerciseMinute, exerciseDistance, exerciseDay, exerciseStart, exerciseEnd, calorie);
        emit ExerciseDataAdded(id, memberId, steps, exerciseMinute, exerciseDistance, exerciseDay, exerciseStart, exerciseEnd, calorie);
    }

    // 운동 데이터 조회 함수
    function getExerciseData(uint id) public view returns (ExerciseData memory) {
        require(exerciseDatas[id].id != 0, "ExerciseData does not exist.");
        return exerciseDatas[id];
    }

    // Receipt 데이터 추가 함수
    function addReceipt(string memory walletType, bool operator, uint price, string memory description, string memory createdAt, uint memberId) public returns (uint) {
        receipts.push(Receipt(walletType, operator, price, description, createdAt, memberId));
        uint receiptId = receipts.length - 1;
        emit ReceiptAdded(receiptId, walletType, operator, price, description, createdAt, memberId);
        return receiptId;
    }

    // 특정 ID를 가진 Receipt 데이터 조회 함수
    function getReceipt(uint receiptId) public view returns (Receipt memory) {
        require(receiptId < receipts.length, "Receipt does not exist.");
        return receipts[receiptId];
    }
}
